import Image from "../assets/explore-bg.png";

const TextComponent = () => {
  return (
    <div className="">
      <h3 className="text-3xl font-bold text-[#0A033C] sm:text-6xl md:text-start text-center
            ">Explore Ethiopia</h3>
      <p className="px-4 lg:px-0 py-4">
        High-definition video is video of higher resolution and quality than
        standard-definition. While there is no standardized meaning for
        high-definition, generally any video.
      </p>
      {/* <div className="flex justify-center lg:justify-start">
        <a
          href="/"
          className="rounded-md bg-[#0A033C] px-3.5 py-2.5 text-sm font-semibold text-white shadow-sm hover:bg-[#9C4DF4]"
        >
          Career Information
        </a>
      </div> */}
    </div>
  );
};

const Explore = () => {
  return (
      <div className="w-full">
    <div className="flex flex-wrap md:flex-nowrap items-center justify-center px-8 py-10 w-3/4 mx-auto gap-8">

      <img
        src={Image}
        alt="Explore Ethiopia"
        className="lg:w-80 sm:w-64 mb-8 lg:mb-0 lg:mr-8"
        />
      <TextComponent />
    </div>
        </div>
  );
};

export default Explore;
